import React from "react";

function OverView() {
  return (
    <div class="container border rounded row" style={{ width: "800px", height: "100px" }}>
      <th class = "col-7"> What you'll learn</th>
        <div class="col-6"><span class='col-re'>&#10004;</span> Create their own Python Programs </div>
        <div class="col-6"><span class='right'>&#10004;</span> Become an experienced Python Programmer</div>
        <div class="col-6"><span class='right'>&#10004;</span> Parse the Web and Create their own Games</div>
    </div>
  );
}

export default OverView;
